import createLucideIcon from '../createLucideIcon';

const Clock3 = createLucideIcon('Clock3Icon', [
  ['circle', { cx: '12', cy: '12', r: '10', key: '1mglay' }],
  ['polyline', { points: '12 6 12 12 16.5 12', key: '1aq6pp' }],
]);

export default Clock3;
